import React, { useState } from 'react'
import { Link } from 'react-router-dom';

function Header() {
    const [value, setValue] = useState();
  return (
    <div>
        <h1>hello</h1>
        <div onChange={(e,val)=> setValue(val)}>
            <Link to="/login"  >Login</Link>
            <div>Signup</div>
        </div>
    </div>
  )
}

export default Header
